import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <table>
      <caption>Invoice</caption>

      <tr>
        <th colspan="4">Invoice#1234567</th>
        <th>19 August 2025</th>
      </tr>


            <tbody align="left">
              <tr>
                <th colspan="2"  >Name/Description</th>
                <th>Qty.</th>
                <th >@</th>
                <th >Cost</th>
              </tr>
              <tr>
                <th rowspan="2">Office Stationary</th>
                <td>Paperclips</td>
                <td>1000</td>
                <td>0.01</td>
                <td>10.00</td>
              </tr>
              <tr >
                <td>Staples(box)</td>
                <td>100</td>
                <td>1.00</td>
                <td>100.00</td>
              </tr>
              <tr>
                <td colspan="2">Book</td>
                <td>10</td>
                <td>2.00</td>
                <td>50.00</td>
              </tr>
            </tbody>
            <tfoot align="left">
              <tr>
                <th colspan="4">Subtotal</th>
                <td>110.00</td>
              </tr>
              <tr>
                <th colspan="3" >Tax</th>
                <td>8%</td>
                <td>8.80</td>
              </tr>
              <tr>
                <th colspan="4"> Grand Total</th>
                <td>$118.80</td>
              </tr>
            </tfoot>
          </table>


          {/* <App /> */}
        </React.StrictMode>



          );

          // If you want to start measuring performance in your app, pass a function
          // to log results (for example: reportWebVitals(console.log))
          // or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
          reportWebVitals();


  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
